import React,{useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Grid, Paper } from '@material-ui/core';
import { BrowserRouter, Switch, Route } from 'react-router-dom'

import Home_AppBar from './Home_Appbar';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import { Form, Col } from 'react-bootstrap';
import ListItemText from '@material-ui/core/ListItemText';
import ListItem from '@material-ui/core/ListItem';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import CloseIcon from '@material-ui/icons/Close';
import Slide from '@material-ui/core/Slide';

import Users  from './UserStore'

const useStyles = makeStyles((theme) => ({
  appBar: {
    position: 'relative',
  },
  title: {
    marginLeft: theme.spacing(2),
    flex: 1,
  },
}));

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="up" ref={ref} {...props} />;
});

const login = ()  => {
  for (var i = 0 ; i < Users.length; i++){
    if(Users[i].GID == Usergid && Users[i].Password == Userpassword){
        setLstate(false)
        //setAdmin(false)
    } else if (Usergid == 'admin' && Userpassword == 'admin') {
        setLstate(false)
        //setAdmin(true)
    } else {
      alert("GID or Password Error!")
    }
  }
}

export default function Home() {
  const classes = useStyles();
  const [open, setOpen] = React.useState(true);
  const [Usergid, setUsergid] = useState('')
  const [Userpassword, setUserpassword] = useState('')

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <BrowserRouter>
      <Switch>
        <div>
          <Grid >
            <Home_AppBar />
          </Grid>

          <Button variant="outlined" color="primary" onClick={handleClickOpen}>
            Open full-screen dialog
          </Button>

          <Dialog fullScreen open={open} onClose={handleClose} TransitionComponent={Transition}>
            <AppBar className={classes.appBar}>
              <Toolbar>
                <IconButton edge="start" color="inherit" onClick={handleClose} aria-label="close">
                  
                </IconButton>
                <Typography variant="h6" className={classes.title}>
                  FACILITY STORE
                </Typography>
                <Button autoFocus color="inherit" onClick={handleClose}>
                 .
                </Button>
              </Toolbar>
            </AppBar>
            <Grid item xs={12} style={{display:'flex' , justifyContent:'space-around',alignItems:'baseline'}}>
              <Paper>
              <Grid item xs={12} style={{marginTop: '40px'}}>
                                    <Form >
                                        <Form.Group >
                                            <Form.Control type="text" size="md" placeholder="GID"  onChange={(e) => { setUsergid(e.target.value)}}/>
                                        </Form.Group>
                                        <Form.Group >
                                            <Form.Control type="password" size="md" placeholder="Password"  onChange={(e) => { setUserpassword(e.target.value)}}/>
                                        </Form.Group>
                                    </Form>
                                </Grid>
                                <Grid item xs={12}>
                                    <Form.Group >
                                        <Button variant="contained" fullWidth color="Primary" onClick={login}>
                                            Login
                                        </Button>
                                    </Form.Group>
                                </Grid>
              </Paper>
            </Grid>
          </Dialog>

        </div>
      </Switch>
    </BrowserRouter>
  );
}
